import React from "react";
import { Link } from "react-router-dom";
import Header from "../components/Header";
import propTypes from 'prop-types';

export default class Home extends React.Component {
  state = {
    info: [],
  };

  componentDidMount() {
    this.getLocalStorage();
  }

  getLocalStorage = () => {
    const {
      location: {
        state: { userName },
      }
    } = this.props;
    const userNameStrg = JSON.parse(localStorage.getItem(userName));
    this.setState({ info: userNameStrg });
  };

  render() {
      const {info: {userName}} = this.state;
    //   console.log(info);
    return (
      <div>
          <header className="header">
        <div>
          <h1>NextConnect</h1>
        </div>
        <div>
        <Link
                        to={ {
                          pathname: `/product/${userName}`,
                          state: { userName },
                        } }
                      >Profile</Link>
          <button type="button">SING OUT</button>
        </div>
      </header>
        <h1>Home</h1>
      </div>
    );
  }
}

Home.propTypes = {
    location: propTypes.shape({
        state: propTypes.shape({
          cartProducts1: propTypes.oneOfType([
            propTypes.array,
          ]),
        }),
      }),
    }.isRequired;
